// RASTERIZE IMAGE

import p5 from 'p5'
import html2canvas from 'html2canvas'
import { getRandomArbitrary, generateHash } from '../prototypes/utilities'

import image1Url from '../../assets/images/deepface-dark-green-black.png'

let img, 
    colorFG = '#111111',
    colorBG = '#f1f1f1';


    p.preload = () => {
      img = p.loadImage(image1Url);
    }

function sketch(p) {
  p.setup = () => {
    const canvas = p.createCanvas(700, 410)
    canvas.parent('prototype_47')
    p.background(0)
    p.image(img, 0, 0)
  }

  p.draw = () => {}
}

document.addEventListener('DOMContentLoaded', () => {
  new p5(sketch)
})
